import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    container: {
      
   
      flex: 1,
  
  
      backgroundColor: '#fff',
      width: '100%',
      height: '100%',
      flexDirection:'column',
    },
    containerh:{
        width:'100%',
        height:'5%',
        backgroundColor:'#3e4',


    },
    containerf:{
        alignSelf:'flex-end',
        width:'100%',
        height:'5%',
        backgroundColor:'#3e4',


    },
  
  
  });

  export default styles;
